import React from "react";
import { Card } from "antd";
const Todo = () => {
  return (
    <Card
      actions={[
        <div key="edit">
          수정
          <br />
        </div>,
        <div key="setting">
          설정
          <br />
        </div>,
      ]}
    ></Card>
  );
};

export default Todo;
